export var WordleLetterPlacement;
(function (WordleLetterPlacement) {
    WordleLetterPlacement[WordleLetterPlacement["good"] = 0] = "good";
    WordleLetterPlacement[WordleLetterPlacement["badPlacement"] = 1] = "badPlacement";
    WordleLetterPlacement[WordleLetterPlacement["wrong"] = 2] = "wrong";
    WordleLetterPlacement[WordleLetterPlacement["empty"] = 3] = "empty";
})(WordleLetterPlacement || (WordleLetterPlacement = {}));
export class WordleLetterModel {
    constructor(letter = "", placement = WordleLetterPlacement.empty) {
        this.letter = letter;
        this.placement = placement;
    }
}
